import React from 'react';
import Garden from "./Garden";

export default function ActionLink() {
    function handleClick(e) {
      e.preventDefault();
      return <Garden/>
    }
    return (

      <button href="#" type="submit" className="btn btn-primary mt-5" onClick={handleClick}>
        Add a garden
      </button>
    );
  }
